import { Avatar, Box, Button, Checkbox, FormControlLabel, Grid, TextField, Typography } from "@material-ui/core";
import React, { useEffect } from "react";
import LockOutlinedIcon from '@material-ui/icons/LockOutlined';
import { LOGIN } from "../../../api"; 
import { Link } from "react-router-dom";
import {useFormik} from 'formik'
//for fetch data use useEffect babe
const SignIn =()=>{
    const handleSubmitForm= ()=>{
        console.log('submited');
    };

    const handleResetForm =()=>{
        console.log('reseted');
    }

     const formik = useFormik({
        initialValues:{
            fullname : '',
            username:'',
            email:'',
            password:'',
            confirmpassword:'',
      },
      onSubmit: handleSubmitForm,
     }
        
     );

    return (
        <Box
        sx={{
          marginTop: 8,
          display: 'flex',
          flexDirection: 'column',
          alignItems: 'center',
        }}
      >
        <Avatar sx={{ m: 1, bgcolor: 'secondary.main' }}>
          <LockOutlinedIcon />
        </Avatar>
        <Typography component="h1" variant="h5">
          Sign in
        </Typography>
        <Box component='form' onSubmit={formik.handleSubmit }  sx={{ mt: 1 }}>
          <TextField
            margin="normal"
            required
            fullWidth
            id="fullName"
            label="Full Name"
            name="fullname"
            autoFocus
            value={formik.values.fullname}
            onChange={formik.onChange}
          />
          <TextField
            margin="normal"
            required
            fullWidth
            id="username"
            label="UserName"
            name="username"
            autoFocus
            value={formik.values.username}
            onChange={formik.onChange}
          />
          <TextField
            margin="normal"
            required
            fullWidth
            id="email"
            label="Email Address"
            name="email"
            autoComplete="email"
            autoFocus
            value={formik.values.email}
            onChange={formik.onChange}
          />
          <TextField
            margin="normal"
            required
            fullWidth
            name="password"
            label="Password"
            type="password"
            id="password"
            autoComplete="current-password"
            value={formik.values.password}
            onChange={formik.onChange}
          />
          <TextField
            margin="normal"
            required
            fullWidth
            name="confirmpassword"
            label="Password"
            type="password"
            id="confirmassword"
            autoComplete="current-password"
            value={formik.values.confirmpassword}
            onChange={formik.onChange}
          
          />
          <FormControlLabel
            control={<Checkbox value="remember" color="primary" />}
            label="Remember me"
          />
          <Button
            type="submit"
            fullWidth
            variant="contained"
            sx={{ mt: 3, mb: 2 }}
          >
            Sign In
          </Button>
          <Grid container>
            <Grid item xs>
                
                <Link href="/*" variant="body2">
                    Forgot password?
                </Link>
            </Grid>
            <Grid item>
              <Link href="/*" variant="body2">
                {"Don't have an account? Sign Up"}
              </Link>
            </Grid>
          </Grid>
        </Box>
      </Box> 
    )
};

export default SignIn;
